-- ----------------------------
-- Table structure for `netmre_assess_field`
-- ----------------------------
DROP TABLE IF EXISTS `netmre_assess_field`;
CREATE TABLE `netmre_assess_field` (
  `id` int(20) NOT NULL AUTO_INCREMENT COMMENT 'id号  自增',
  `pid` int(20) DEFAULT NULL COMMENT '父id',
  `pstring` varchar(255) DEFAULT NULL COMMENT '父路径',
  `level` tinyint(1) DEFAULT '1' COMMENT '指标级别',
  `big_no` int(11) DEFAULT '0' COMMENT '大类序号',
  `second_no` int(11) DEFAULT '0' COMMENT '二级分类序号',
  `third_no` int(11) DEFAULT '0' COMMENT '三级序号',
  `name` varchar(255) DEFAULT NULL COMMENT '字段名称',
  `option` text COMMENT '选项内容,存放json数据',
  `calculate_type` tinyint(1) DEFAULT '0' COMMENT '计算类型  0-子选项总分求和  1-子选项单选',
  `calculate_function` varchar(255) DEFAULT NULL COMMENT '自定义计算方法名',
  `score` float(11,2) DEFAULT NULL COMMENT '总分',
  `status` tinyint(1) DEFAULT '0' COMMENT '状态 0-正常 1-删除',
  `indicator_hints` text COMMENT '鎸囨爣璇勫垎鏍囧噯',
  `createtime` int(11) DEFAULT NULL COMMENT '添加时间',
  `deletetime` int(11) DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=69 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of netmre_assess_field
-- ----------------------------

-- ----------------------------
-- Table structure for `netmre_assess_info`
-- ----------------------------
DROP TABLE IF EXISTS `netmre_assess_info`;
CREATE TABLE `netmre_assess_info` (
  `id` varchar(32) NOT NULL DEFAULT '' COMMENT 'UUID',
  `year` int(4) DEFAULT NULL COMMENT '申报年份',
  `uid` varchar(32) DEFAULT NULL COMMENT '用户id',
  `city` varchar(11) DEFAULT '0' COMMENT '城市id',
  `score` float(11,2) DEFAULT NULL COMMENT '总分',
  `createtime` int(11) DEFAULT NULL,
  `deletetime` int(11) DEFAULT NULL,
  `status` tinyint(1) DEFAULT '0' COMMENT '状态 0-申请未提交 1-已提交待审核 2-审核通过未评估 3-开始评估 4-评估完成生成报告  8-审核未通过  9-删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

