  `id` int(11) NOT NULL AUTO_INCREMENT,
  `year` int(4) DEFAULT NULL COMMENT '年份',
  `starttime` bigint(10) NOT NULL COMMENT '评估开始时间',
  `endtime` bigint(10) NOT NULL COMMENT '评估结束时间',
  `area` text COMMENT 'id,id,id',
  `msg` text COMMENT '规则描述',
  `timecreated` bigint(10) NOT NULL COMMENT '创建时间',
  `timemodified` bigint(10) DEFAULT NULL COMMENT '修改时间',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0 正常  1 删除',
  PRIMARY KEY (`id`)
