CREATE TABLE `netmre_assess_info_value` (
  `id` char(32) NOT NULL,
  `infoid` char(32) DEFAULT NULL COMMENT '评估id号',
  `fieldid` int(11) DEFAULT NULL COMMENT '字段id',
  `value` text COMMENT '字段值，存json',
