-- Table structure for `netmre_log`
-- ----------------------------
DROP TABLE IF EXISTS `netmre_log`;
CREATE TABLE `netmre_log` (
  `id` char(32) NOT NULL,
  `uid` char(32) NOT NULL COMMENT '操作者id',
  `infoid` char(32) DEFAULT NULL COMMENT '被操作信息',
  `type` tinyint(1) NOT NULL COMMENT '日志类型：\r\n0-用户登录\r\n1-用户信息管理\r\n2-权限管理\r\n3-机构管理\r\n4-贫困户信息管理\r\n5-贫困原因管理\r\n6-贫困事务管理\r\n7-贫困事务处理\r\n',
  `additionalid` char(32) DEFAULT NULL COMMENT '被操作附加id',
  `originalinfo` text COMMENT '存放原始信息，添加为空',
  `resultinfo` text COMMENT '存变更之后的信息',
  `createtime` int(11) NOT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

